import react from 'react';
import styled from 'styled-components';

const Circle = styled.div`
    width: 100px;
    height: 100px;
    background-color: red;
    border-radius: 50%;
`

const Main = () => {
    return (
        <div>
        <h1>Main</h1>
        <Circle />
        </div>
    );
    }

export default Main;
